import React from "react";
import { Button, Container } from "react-bootstrap";

const Admin = () => {
    return (
        <Container>
            <Button variant="outline-primary">
                Добавить категорию
            </Button>
            <Button>
                Добавить бренд
            </Button>
            <Button>
                Добавить устройство
            </Button>
        </Container>       
    )
}

export default Admin;
